description:
Discovering: Fleetwood Mac

Arts Documentary hosted by Cal Saville, published by BSkyB in 2014 - English narration


Information
------------------------------

Discovering: Fleetwood Mac 
Music journalists Camilla Pia, Will Hodgkinson and John Aizlewood are among those reflecting on the tumultuous history of Fleetwood Mac, from their early days led by founder Peter Green to the departure of Lindsey Buckingham ahead of a world tour in 1987. As well as discussing the band's deeply strained and intertwined personal lives, they examine how 1977 album Rumours exposed the turmoil that existed in the group at the time, and look at the experimental nature of 1970 release Tusk

